(function () {
    "use strict";
    function PLoader() {
        this.init();
    }

    var loaderCss = '.preloader-indicator-modal.loader-in{opacity:1;-webkit-transition-duration:400ms;transition-duration:400ms;-webkit-transform:translate3d(0, 0, 0) scale(1);transform:translate3d(0, 0, 0) scale(1)}.modal-overlay,.preloader-indicator-overlay,.popup-overlay,.picker-modal-overlay{position:absolute;left:0;top:0;width:100%;height:100%;background:rgba(0, 0, 0, .4);z-index:10600;visibility:hidden;opacity:0;-webkit-transition-duration:400ms;transition-duration:400ms}.modal-overlay.modal-overlay-visible,.preloader-indicator-overlay.modal-overlay-visible,.popup-overlay.modal-overlay-visible,.picker-modal-overlay.modal-overlay-visible{visibility:visible;opacity:1}.modal-preloader .modal-title,.modal-preloader .modal-inner{text-align:center}.preloader-indicator-overlay{visibility:visible;opacity:0;background:none}.preloader-indicator-modal{-webkit-transition-duration:400ms;transition-duration:400ms;position:absolute;left:50%;top:50%;padding:8px;margin-left:-24px;margin-top:-24px;background:rgba(0, 0, 0, .8);z-index:11000;border-radius:4px;-webkit-transform:translate3d(0, 0, 0) scale(0);transform:translate3d(0, 0, 0) scale(0)}.preloader-indicator-modal .preloader{display:block}.preloader{font-size:0;display:inline-block;width:32px;height:32px;-webkit-animation:preloader-outer 6600ms linear infinite;animation:preloader-outer 6600ms linear infinite}.preloader svg{width:100%;height:100%;-webkit-animation:preloader-inner 1320ms linear infinite;-ms-animation:preloader-outer 3300ms linear infinite}.preloader svg circle{fill:none;stroke:#757575;stroke-linecap:square;-webkit-animation:preloader-arc 1320ms cubic-bezier(0.8, 0, .4, .8) infinite;animation:preloader-arc 1320ms cubic-bezier(0.8, 0, .4, .8) infinite}.preloader.preloader-white svg circle{stroke:#fff}@-webkit-keyframes preloader-outer{0%{-webkit-transform:rotate(0deg)}100%{-webkit-transform:rotate(360deg)}}@keyframes preloader-outer{0%{transform:rotate(0deg)}100%{transform:rotate(360deg)}}@-webkit-keyframes preloader-inner{0%{-webkit-transform:rotate(-100.8deg)}100%{-webkit-transform:rotate(0deg)}}@keyframes preloader-inner{0%{transform:rotate(-100.8deg)}100%{transform:rotate(0deg)}}@-webkit-keyframes preloader-arc{0%{stroke-dasharray:1 210.48670779;stroke-dashoffset:0}40%{stroke-dasharray:151.55042961, 210.48670779;stroke-dashoffset:0}100%{stroke-dasharray:1 210.48670779;stroke-dashoffset:-151.55042961}}@keyframes preloader-arc{0%{stroke-dasharray:1 210.48670779;stroke-dashoffset:0}40%{stroke-dasharray:151.55042961, 210.48670779;stroke-dashoffset:0}100%{stroke-dasharray:1 210.48670779;stroke-dashoffset:-151.55042961}}';
    var helper = PLoader.prototype.helper = {
        supportAnimation: function (dom) {
            var userAgent = navigator.userAgent;
            var isIE11 = userAgent.search(/Trident/i);
            var isIE10reg = /MSIE 10.0/;
            var isIE10 = isIE10reg.test(userAgent);
            if ("ActiveXObject" in window) {
                return isIE11 && isIE10;
            } else {
                return true
            }
        }
    };
    PLoader.prototype.init = function () {
        var that = this;
        that.importCss(loaderCss);
    };
    PLoader.prototype.importHTML = function (type) {
        var dom = document.createElement("div");
        dom.innerHTML = '<div class="preloader-indicator-overlay"></div>';
        document.body.appendChild(dom.children[0]);
        switch (type) {
            case "gif":
                dom.innerHTML = '<div class="preloader-indicator-modal loader-in"><span class="preloader preloader-white"><img width="32" height="32" src="data:image/gif;base64," alt=""></span></div><script>';
                break;
            case "svg":
                dom.innerHTML = '<div class="preloader-indicator-modal"><span class="preloader preloader-white"><svg xmlns="http://www.w3.org/2000/svg" height="75" width="75" viewBox="0 0 75 75"><circle cx="37.5" cy="37.5" r="33.5" stroke-width="8" stroke-dasharray="100,35" ></circle></svg></span></div>';
                break;
            default:
                break;
        }
        document.body.appendChild(dom.children[0]);
    };
    PLoader.prototype.show = function () {
        var that = this;
        if (helper.supportAnimation()) {
            this.importHTML("svg");
        } else {
            this.importHTML("gif");
        }

        var node = document.querySelector(".preloader-indicator-modal");
        setTimeout(function () {
            node.className = "preloader-indicator-modal loader-in";
        }, 0);
    };
    PLoader.prototype.hide = function () {
        if (document.querySelector(".preloader-indicator-overlay")) {
            document.body.removeChild(document.querySelector(".preloader-indicator-overlay"));
        }
        if (document.querySelector(".preloader-indicator-modal")) {
            var node = document.querySelector(".preloader-indicator-modal");
            node.className = "preloader-indicator-modal";
            setTimeout(function () {
                document.body.removeChild(node);
            }, 400);
        }
    };
    PLoader.prototype.importCss = function () {
        var link = document.createElement("style");
        link.innerHTML = loaderCss;
        link.id = "pLoaderCSS";
        if (!document.querySelector("#pLoaderCSS")) {
            document.getElementsByTagName("head")[0].appendChild(link);
        }
    };
    window.pLoader = new PLoader();
})();